import React from "react";
import { motion } from "framer-motion";
import {
  Variants,
  Transition,
  ChildVariants
} from "../components/AnimationVariables";

const First = () => {
  return (
    <motion.div
      className="first"
      key="first"
      initial="initial"
      animate="in"
      exit="out"
      variants={Variants}
      transition={Transition}
    >
      <motion.p
        initial={{ y: 100, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.8, delay: 0.2 }}
      >
        This is the First page.
      </motion.p>
    </motion.div>
  );
};

export default First;
